message.entry:
数据为 MESHGRID 格式，需要使用 NDGRID 格式。
请按如下所示转换数据:
 P = [2 1 3];
 X = permute(X, P);
 Y = permute(Y, P);
 Z = permute(Z, P);
 V = permute(V, P);
 F = griddedInterpolant(X,Y,Z,V)

查询数据为 MESHGRID 格式，NDGRID 格式会产生更好的性能。
请按如下所示转换查询数据(Xq, Yq):
 F = griddedInterpolant(. . .);
 Xq = Xq'; Yq = Yq';
 Vq = F(Xq,Yq);

查询数据为 MESHGRID 格式，NDGRID 格式会产生更好的性能。
请按如下所示转换查询数据(Xq, Yq, Zq):
 F = griddedInterpolant(. . .);
 P = [2 1 3];
 Xq = permute(Xq, P);
 Yq = permute(Yq, P);
 Zq = permute(Zq, P);
 Vq = F(Xq,Yq,Zq);
